/*
  整个项目入口文件
*/
//引入Vue
import Vue from 'vue'
//引入App组件，所有组件的父组件
import App from './App.vue'

Vue.config.productionTip = false

//创建Vue实例对象
new Vue({
  el:'#app',
  render: h => h(App),
})//.$mount('#app')
